import React from "react";
import styles from "./Styles.module.scss";

function MapMenu(props) {
  return (
    <div className={styles.MapMenu}>
      <input type="text" />
      <div>
        <span>
          {props.listPoints.map((item) => item.properties.iconCaption)}
        </span>
      </div>
    </div>
  );
}

export default MapMenu;
